import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
import Building from "./building/building";
import axios from "axios";
const emptyclass = () => {
    const navigate = useNavigate();
    function emptyHandler() {
        navigate("/home/")
    }
    axios({
        method: "get",
        url: "/api/empty_room",
        headers: {
            "Content-Type": "multipart/form-data",
            "traefik": "jwzx",
        },
    }).then(res => {
        console.log(res);
    }, err => {
        console.log(err)
    });
    return (
        <div id="empty-bg" >
            <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require("./emptypic/returnarrow.png")} id="emparr" /></button>
                空闲教室
            </div>
            <div id="emptychoice">
                <div id="1fdiv"><img src={require("./emptypic/if.jpg")} id="1f" className="buildingpic" /></div>
                <div id="1fdiv"><img src={require("./emptypic/if.jpg")} id="1f" className="buildingpic" /></div>
                <div id="1fdiv"><img src={require("./emptypic/if.jpg")} id="1f" className="buildingpic" /></div>
                <div id="1fdiv"><img src={require("./emptypic/if.jpg")} id="1f" className="buildingpic" /></div>
                <div id="1fdiv"><img src={require("./emptypic/if.jpg")} id="1f" className="buildingpic" /></div>
            </div>
            <div id="classchoice">
                <div id="building">
                    <Building/>
                </div>
            </div>
        </div>)
}
export default emptyclass;
